import React, { useState, useEffect } from 'react';

function AdminDashboard() {
  const [registros, setRegistros] = useState([]);
  const [formData, setFormData] = useState({
    nombre: '',
    cvu: '',
    instituto: '',
    pais: '',
    telefono: '',
    correo: '',
    tipoEstancia: '',
    responsable: '',
    proyecto: '',
    justificacion: '',
    fecha_inicio: '',
    fecha_fin: '',
    curp: '',
    solicitud: 'no', // Por defecto, no se selecciona la solicitud de correo
  });
  const [modoEdicion, setModoEdicion] = useState(false);
  const [idEditar, setIdEditar] = useState(null);

  useEffect(() => {
    cargarRegistros();
  }, []);

  const cargarRegistros = async () => {
    try {
      const response = await fetch('http://localhost:8000/api/registros');
      const data = await response.json();
      setRegistros(data);
    } catch (error) {
      console.error('Error al cargar los registros:', error);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      if (modoEdicion) {
        await fetch(`http://localhost:8000/api/registros/${idEditar}`, {
          method: 'PUT',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(formData),
        });
        setModoEdicion(false);
        setIdEditar(null);
      } else {
        await fetch('http://localhost:8000/api/registros', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(formData),
        });
      }
      cargarRegistros();
      limpiarFormulario();
    } catch (error) {
      console.error('Error al guardar el formulario:', error);
    }
  };

  const limpiarFormulario = () => {
    setFormData({
      nombre: '',
      cvu: '',
      instituto: '',
      pais: '',
      telefono: '',
      correo: '',
      tipoEstancia: '',
      responsable: '',
      proyecto: '',
      justificacion: '',
      fecha_inicio: '',
      fecha_fin: '',
      curp: '',
      solicitud: 'no', // Reinicia la solicitud de correo a 'no'
    });
  };

  const handleEditar = (registro) => {
    setModoEdicion(true);
    setIdEditar(registro.id);
    setFormData({
      nombre: registro.nombre,
      cvu: registro.cvu,
      instituto: registro.instituto,
      pais: registro.pais,
      telefono: registro.telefono,
      correo: registro.correo,
      tipoEstancia: registro.tipoEstancia,
      responsable: registro.responsable,
      proyecto: registro.proyecto,
      justificacion: registro.justificacion,
      fecha_inicio: registro.fecha_inicio,
      fecha_fin: registro.fecha_fin,
      curp: registro.curp,
      solicitud: registro.solicitud,
    });
  };

  const handleEliminar = async (id) => {
    try {
      await fetch(`http://localhost:8000/api/registros/${id}`, {
        method: 'DELETE',
      });
      cargarRegistros();
    } catch (error) {
      console.error('Error al eliminar el registro:', error);
    }
  };

  return (
    <div className="container mt-5">
      <h1>Administrador de Registros</h1>
      <div className="row">
        <div className="col-md-6">
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label">Nombre:</label>
              <input type="text" className="form-control" value={formData.nombre} onChange={(e) => setFormData({ ...formData, nombre: e.target.value })} />
            </div>
            {/* Agrega los campos restantes del formulario de acuerdo a tus necesidades */}
            <button type="submit" className="btn btn-primary">{modoEdicion ? 'Actualizar' : 'Agregar'}</button>
          </form>
        </div>
      </div>
      <div className="row mt-3">
        <div className="col-md-6">
          <ul className="list-group">
            {registros.map((registro) => (
              <li key={registro.id} className="list-group-item d-flex justify-content-between align-items-center">
                {registro.nombre} - {registro.cvu} {/* Muestra los campos relevantes */}
                <div>
                  <button className="btn btn-warning me-2" onClick={() => handleEditar(registro)}>Editar</button>
                  <button className="btn btn-danger" onClick={() => handleEliminar(registro.id)}>Eliminar</button>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
